import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./LoginForm.css"; // import the CSS file

const LoginForm = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");

  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    setError("");

    try {
      const response = await fetch("https://qa-uaesaas-api.instapract.ae/web/api/default/login", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          APPID: "Gem3s12345",
        },
        body: JSON.stringify({
          username,
          password,
          role_id: "143f37f2-ca38-0ab1-2489-1e47113655fc",
          device_id: "55c3389cb5ddd720dc0297617f3561c43a36218a277c974c8d43d545a643f45c",
          os_id: "b93a9204-ee21-4cf9-8a94-cf5eeabf7301",
          language: "da315627-3ece-2016-c628-b61dc5ee9be0",
        }),
      });

      const result = await response.json();
      if (response.ok && result.success && result.data.access_token) {
        localStorage.setItem("token", result.data.access_token);
        navigate("/doctor");
      } else {
        setError(result.msg || "Login failed");
      }
    } catch (err) {
      setError("Something went wrong. Please try again.");
    }
  };

  return (
    <div className="login-container">
      <form onSubmit={handleLogin} className="login-form">
        <h2 className="login-title">Lo</h2>

        <div className="form-group">
          <label>Username</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label>Password</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
        </div>

        {error && <div className="error-message">{error}</div>}

        <button type="submit" className="login-button">Login</button>
      </form>
    </div>
  );
};

export default LoginForm;
